// src/pages/VibrationalIntelligence/PackagingLabels.jsx

import React from 'react';
import HeroSection from '../../components/HeroSection';
import PageLayout from '../../components/PageLayout';
import InfoCard from '../../components/InfoCard';
import MasterElementsData from '../../data/MasterElementsData';
import { Link } from 'react-router-dom';

const contentBoxes = [
  {
    id: 'chakras',
    title: 'Chakras',
    image: '/images/packaging/chakras.jpg',
    link: '/vibrationalintelligence/packaginglabels/chakras'
  },
  {
    id: 'fibonacci',
    title: 'Fibonacci',
    image: '/images/packaging/fibonacci.jpg',
    link: '/vibrationalintelligence/packaginglabels/fibonacci'
  },
  {
    id: 'frequency-chart',
    title: 'Frequency Chart',
    image: '/images/packaging/frequency-chart.jpg',
    link: '/vibrationalintelligence/packaginglabels/frequencychart'
  },
  {
    id: 'numerology',
    title: 'Numerology',
    image: '/images/packaging/numerology.jpg',
    link: '/vibrationalintelligence/packaginglabels/numerology'
  },
  {
    id: 'pineal-gland',
    title: 'Pineal Gland',
    image: '/images/packaging/pineal-gland.jpg',
    link: '/vibrationalintelligence/packaginglabels/pinealgland'
  },
  {
    id: 'sacred-geometry',
    title: 'Sacred Geometry',
    image: '/images/packaging/sacred-geometry.jpg',
    link: '/vibrationalintelligence/packaginglabels/sacredgeometry'
  }
];

const PackagingLabels = () => {
  return (
    <PageLayout>
      <HeroSection
        title="Packaging Labels"
        subtitle="Decode the Symbols of Healing and Intention"
        background="/videos/packaging-hero.mp4"
        isVideo={true}
      />

      {/* Paragraph Container */}
      <section className="text-center max-w-4xl mx-auto mt-12 px-4">
        <p className="text-white text-lg">
          Our labels are more than visual designâ€”they are energetic anchors. Each symbol, color, and word carries a vibration intended to enhance the frequency of the product it encases. These labels reflect sacred systems like chakras, numerology, sacred geometry, and the Fibonacci sequence to deepen the connection between intention and product.
        </p>
      </section>

      {/* 6 Content Boxes */}
      <section className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 mt-16 px-4 max-w-6xl mx-auto">
        {contentBoxes.map((box) => (
          <Link
            to={box.link}
            key={box.id}
            className="relative group rounded-2xl overflow-hidden border-4 border-gradient shadow-xl hover:shadow-2xl hover:scale-105 transform transition duration-300"
          >
            <img src={box.image} alt={box.title} className="w-full h-48 object-cover opacity-90 group-hover:opacity-100" />
            <div className="absolute inset-0 bg-black bg-opacity-40 flex items-center justify-center">
              <h3 className="text-xl text-yellow-400 font-bold drop-shadow-md group-hover:drop-shadow-lg">
                {box.title}
              </h3>
            </div>
          </Link>
        ))}
      </section>

      {/* Info Cards Container */}
      <section className="max-w-5xl mx-auto mt-20 grid grid-cols-1 md:grid-cols-2 gap-6 px-4">
        {MasterElementsData.map((entry) => (
          <InfoCard key={entry.id} data={entry} />
        ))}
      </section>

      {/* Final Paragraph Container */}
      <section className="text-center max-w-4xl mx-auto mt-20 px-4">
        <p className="text-white font-semibold">
          These packaging symbols are tools of frequency literacy. They empower you to know the deeper function and energy behind every product you consume.
        </p>
      </section>
    </PageLayout>
  );
};

export default PackagingLabels;
